    false,nt"url": null,nt"notes": "This annual narrative report for Seney
    National Wildlife Refuge, Michigan Islands National Wildlife Refuge, Harbor Island
    National Wildlife Refuge, Huron Islands National Wildlife Refuge, and Kirtlandu2019s
    Warbler National Wildlife Refuge summarizes activities during the 1997 calendar
    year. The report begins with an introduction to the Refuge and a summary of the
    yearu2019s highlights and climatic conditions. Information about monitoring and
    studies- including surveys and censuses- is provided next. Habitat restoration and
    management projects are also covered; activities include wetland restoration, riverine
    restoration, water level management, haying, timber management, and fire management.
    Fish and wildlife management is discussed next with emphasis on bird banding, reintroductions,
    nest structures, and animal control. Coordination activities, such as Friends organizations,
    are outlined. The resource protection section provides information about law enforcement,
    contaminant investigations, and land acquisition. Information about public education
    and recreation is given including visitor services and outreach. Finally, general
    administration is discussed in the Refuge planning and administration section. Refuge
    brochures are attached.",nt"license_title": "License Not Specified",nt"extras":
